      ,(60003600004031,ARRAY[60003300059637],ST_POINT(-86.90509146,49.30743199,4269),25)
      ,(60003300060509,ARRAY[60003600004031],ST_POINT(-86.90812071,49.29772587,4269),25)
      ,(60003600000933,ARRAY[60003300070688,60003600004654],ST_POINT(-86.91781268,49.27847258,4269),25)
      ,(60003300070688,ARRAY[60003600004654],ST_POINT(-86.91872627,49.27780764,4269),25)
      ,(60003300070688,ARRAY[60003600004654],ST_POINT(-86.91919904,49.27160689,4269),25)
      ,(60003300070421,ARRAY[60003600003406],ST_POINT(-86.9395431,49.27319441,4269),25)
      ,(60003300064742,ARRAY[60003600004015],ST_POINT(-86.9500181,49.24072327,4269),13)
      ,(60003600004015,ARRAY[60003300064742],ST_POINT(-86.94998135,49.24090267,4269),13)
      ,(60003300059876,ARRAY[60003600003992],ST_POINT(-86.95778594,49.22620227,4269),20)
      ,(60003600000321,ARRAY[60003300064981,60003600003990],ST_POINT(-86.96620697,49.19754974,4269),20)
      ,(60003300071880,ARRAY[60003600002738,60003600003990],ST_POINT(-86.9697348,49.19466508,4269),20)
      ,(60003600002713,ARRAY[60003300058385],ST_POINT(-86.96660904,49.16681374,4269),20)
      ,(60003600003961,ARRAY[60003300071829],ST_POINT(-86.97730013,49.15762846,4269),20)
      ,(60003300070871,ARRAY[60003600004558],ST_POINT(-87.00792745,49.11679799,4269),20)
      ,(60003300072239,ARRAY[60003600001440],ST_POINT(-87.0245789,49.1104916,4269),20)
      ,(60003600001440,ARRAY[60003300072239],ST_POINT(-87.02402477,49.10762069,4269),20)
      ,(60003600001441,ARRAY[60003300072239,60003600001440],ST_POINT(-87.0253969,49.10652827,4269),20)
      ,(60003300057469,ARRAY[60003600004508],ST_POINT(-87.03901875,49.09842697,4269),20)
      ,(60003600004508,ARRAY[60003300065509],ST_POINT(-87.04658389,49.09003288,4269),20)
      ,(60003600004508,ARRAY[60003300072886],ST_POINT(-87.0499729,49.08330329,4269),20)
      ,(60003600004470,ARRAY[60003300072886],ST_POINT(-87.05851758,49.0765401,4269),20)
      ,(60003600004470,ARRAY[60003300072886],ST_POINT(-87.05860727,49.07583484,4269),20)
      ,(60003600004470,ARRAY[60003300057852],ST_POINT(-87.06118682,49.07110934,4269),20)
   ) AS t(expand,static,patch,size)
   LOOP
      IF r.expand = ANY(r.static)
      THEN
         RAISE EXCEPTION 'QA failure for % with same value in static list',r.expand;
      
      END IF;   
   
      BEGIN
         patchgeo := ST_BUFFER(
             ST_TRANSFORM(r.patch,int_srid)
            ,r.size
            ,'quad_segs=2'
         );
         
      EXCEPTION
         WHEN OTHERS THEN
            RAISE WARNING '% % % %',r.expand,r.static,ST_ASEWKT(r.patch),r.size;
            RAISE;
      
      END;
      
      SELECT
      ST_UNION(
         cipsrv_nhdplus_h.snap_to_common_grid(ST_TRANSFORM(a.shape,int_srid),int_srid::VARCHAR,0.001)
      )
      INTO staticgeo
      FROM (
         SELECT
          aa.nhdplusid
         ,aa.shape
         FROM
         cipsrv_nhdplus_h.nhdpluscatchment aa
         UNION ALL
         SELECT
          bb.nhdplusid
         ,bb.shape
         FROM
         cipsrv_epageofab_h.grid0catchment bb
      ) a
      WHERE 
      a.nhdplusid = ANY(r.static);
      
      IF staticgeo IS NULL
      OR ST_ISEMPTY(staticgeo)
      OR ST_SRID(staticgeo) = 0
      THEN
         RAISE EXCEPTION '% % % %',r.expand,r.static,ST_ASEWKT(r.patch),r.size;
         
      END IF;
      
      IF ST_DISTANCE(
          patchgeo
         ,staticgeo
      ) > 50
      THEN
         RAISE EXCEPTION 'QA distance check for % %',r.expand,r.static;
      
      END IF;
      
      BEGIN
         SELECT
         ST_UNION(
             cipsrv_nhdplus_h.snap_to_common_grid(ST_TRANSFORM(a.shape,int_srid),int_srid::VARCHAR,0.001)
            ,cipsrv_nhdplus_h.snap_to_common_grid(patchgeo,int_srid::VARCHAR,0.001)
         )
         INTO step1geo
         FROM
         cipsrv_nhdplus_h.nhdpluscatchment a
         WHERE
         a.nhdplusid = r.expand;
      
      EXCEPTION
         WHEN OTHERS THEN
            RAISE WARNING '% % % %',r.expand,r.static,ST_ASEWKT(r.patch),r.size;
            RAISE;
      
      END;
      
      IF step1geo IS NULL
      OR ST_ISEMPTY(step1geo)
      OR ST_SRID(step1geo) = 0
      THEN
         RAISE EXCEPTION '% % % % %',r.expand,r.static,ST_ASEWKT(r.patch),r.size,ST_ASEWKT(step1geo);
         
      END IF;
      
      BEGIN
         SELECT
         ST_DIFFERENCE(
             step1geo
            ,staticgeo
         )
         INTO step2geo;
      
      EXCEPTION
         WHEN OTHERS THEN
            RAISE WARNING '% % % %',r.expand,r.static,ST_ASEWKT(r.patch),r.size;
            RAISE;
      
      END;
      
      IF step2geo IS NULL
      OR ST_ISEMPTY(step2geo)
      OR ST_SRID(step2geo) = 0
      THEN
         RAISE EXCEPTION '% % % % %',r.expand,r.static,ST_ASEWKT(r.patch),r.size,ST_ASEWKT(step2geo);
         
      END IF;
      
      BEGIN
         UPDATE cipsrv_nhdplus_h.nhdpluscatchment a
         SET shape = ST_TRANSFORM(step2geo,4269)
         WHERE 
         a.nhdplusid = r.expand;
         
      EXCEPTION
         WHEN OTHERS THEN
            RAISE WARNING '% % % %',r.expand,r.static,ST_ASEWKT(r.patch),r.size;
         RAISE;
         
      END;
         
      UPDATE cipsrv_nhdplus_h.nhdpluscatchment a
      SET areasqkm = ST_AREA(ST_TRANSFORM(a.shape,int_srid))::NUMERIC / 1000000
      WHERE 
      a.nhdplusid = r.expand;
        
   END LOOP;
    
END$$;

